import { Component } from '@angular/core';
import { NavController, NavParams, AlertController  } from 'ionic-angular';
import { Storage } from '@ionic/storage';
import { User } from '../../models/user';
import { storage } from 'firebase';
import { Camera, CameraOptions } from '@ionic-native/camera';

import { LoginPage } from '../login/login';

@Component({
  selector: 'page-home',
  templateUrl: 'home.html',
})
export class HomePage {
  user = {} as User;
  
  constructor(
    public navCtrl: NavController,
    public navParams: NavParams,
    private camera: Camera,
    private alertCtrl: AlertController,
    private storage: Storage) {
    
    // check if user exists
    this.storage.get('user_login').then((val) => {
      if (val != null) {
        this.user = JSON.parse(val);
      }
    });
  }

  async takePhoto() {
    try {
      // capture image
      const cameraParam: CameraOptions = {
        quality: 50,
        targetHeight: 600,
        targetWidth: 600,
        destinationType: this.camera.DestinationType.DATA_URL,
        encodingType: this.camera.EncodingType.JPEG,
        mediaType: this.camera.MediaType.PICTURE
      }
      const cameraResult = await this.camera.getPicture(cameraParam);
      const cameraImage = `data:image/jpeg;base64,${cameraResult}`;
      // const cameraImage = `data:image/jpeg;base64,`;

      // upload it
      const pictures = storage().ref('pictures');
      pictures.putString(cameraImage, 'data_url').then((result) => {
        let alert = this.alertCtrl.create({
          title: result.state,
          subTitle: 'Uploaded a base64url string!',
          buttons: ['Dismiss']
        });
        alert.present();
      });
    }
    catch(e) {
      console.error(e);
    }
  }

  signOut() {
    this.storage.remove('user_login').then(() => {
      this.navCtrl.push(LoginPage);
    });
  }
}
